import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import logo from '../assets/logo.png';
import { Navbar, Nav, Form, FormControl, Button, Container, 
         Collapse, NavDropdown, Offcanvas, Image } from 'react-bootstrap';
import '../css/header.css';
import { FaUserCircle } from "react-icons/fa";

const CinemaHeader: React.FC = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [searchQuery, setSearchQuery] = useState('');
    const location = useLocation();

    // Toggle Menu
    const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

    // Handle Search
    const handleSearch = (e: React.FormEvent) => {
        e.preventDefault();
        console.log('Searching for:', searchQuery);
        // Add search logic here (e.g., API call or navigation)
    };

    const isActive = (path: string) => location.pathname === path;

    return (
        <>
          {['sm'].map((expand) => (
            <Navbar key={expand} expand={expand} className=" mb-3"
                style={{backgroundColor:'#1b2735'}}
            >
            <Container fluid>
                <Image src={logo} className=' mx-2' style={{width:'70px'}}  alt="logo" roundedCircle />                
                <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} className='bg-white text-white'/>
                <Navbar.Offcanvas
                    id={`offcanvasNavbar-expand-${expand}`} aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`} placement="end"
                    style={{backgroundColor:'#1b2735', height: '20px'}}
                >
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`} className='text-white'>
                        <strong>Cinema</strong>
                    </Offcanvas.Title>
                </Offcanvas.Header >
                <Offcanvas.Body>
                    <Nav className="justify-content-center d-flex mx-auto text-center flex-grow-1 pe-3">
                        <Nav.Link href="#action1" className=' text-white px-3'><strong>Phim</strong></Nav.Link>
                        <Nav.Link href="#action2" className=' text-white px-3'><strong>Rạp/Giá vé</strong></Nav.Link>
                        <Nav.Link href="#action2" className=' text-white px-3'><strong>Lịch chiếu</strong></Nav.Link>
                        <Nav.Link href="#action2" className=' text-white px-3'><strong>Sự kiện/Tin tức</strong></Nav.Link>
                        <NavDropdown
                            className=''
                            title={
                                <>
                                    <FaUserCircle size={25} className=' text-white'/>
                                </>
                            }
                            id={`offcanvasNavbarDropdown-expand-${expand}`}
                        >
                            <NavDropdown.Item href="#action3"><strong>Đăng nhập</strong></NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action4"><strong>Đăng ký</strong></NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    <Form className="d-flex search-form" style={{left: "-50px"}}>
                        <div className="input-group">
                            <Form.Control
                                type="search"
                                placeholder="Tìm kiếm..."
                                className="rounded-pill search-input px-5"
                                aria-label="Search"
                            />
                            <Button variant="light" className="rounded-pill search-button"
                                style={{left: "-40px", zIndex: 5}}
                            >
                                <i className="bi bi-search"></i>
                            </Button>
                        </div>
                    </Form>
                </Offcanvas.Body>
                </Navbar.Offcanvas>
            </Container>
            </Navbar>
        ))}
        </>
      );
};

export default CinemaHeader;
